query SearchUpcomingLaunches($query: String!) {
  upcomingLaunches(limit: 20, search: $query) {
    pageInfo {
      count
      __typename
    }
    results {
      id
      name
      weatherConcerns
      rocket {
        id
        configuration {
          fullName
          __typename
        }
        __typename
      }
      mission {
        name
        description
        __typename
      }
      webcastLive
      provider {
        name
        __typename
      }
      __typename
    }
    __typename
  }
}
